//targetTable\u662F\u9700\u8981\u63A7\u5236\u7684table\u7EC4\u4EF6\u7684ref\u5F15\u7528
export default {
  data() {
    return {
      // \u63A7\u5236\u8868\u683C\u5217\u7684\u663E\u793A\u9690\u85CF,\u4F8B\u5982\uFF1A['\u7BA1\u7406\u5355\u4F4D','\u91C7\u96C6\u65F6\u95F4'...]
      visibleKeys: null,
      /*****
       * \u7531table\u7684\u65B9\u6CD5\u4F20\u9012\u8FC7\u6765\u7684\u6570\u636E\uFF0C\u662F\u5305\u542B\u4E86\u6240\u6709column\u7684\u6570\u636E
       * \u4F8B\u5982\uFF1A[{key:'\u7BA1\u7406\u5355\u4F4D',prop:'orgName'},{},...]
       */
      lossGridData: [],
    };
  },
  watch: {
    lossGridData: {
      //\u5728\u6700\u5F00\u59CBtable\u7EC4\u4EF6\u52A0\u8F7D\u5B8C\u6210\u540E\uFF0C\u4F1A\u89E6\u53D1\u6B64\u65B9\u6CD5\uFF0C\u5C06\u6240\u6709\u7684column\u6570\u636E\u4F20\u9012\u8FC7\u6765
      //\u6211\u4EEC\u9ED8\u8BA4\u8BBE\u7F6E\u4E3A\u663E\u793A\u6240\u6709\u7684\u5217
      handler(val) {
        val.forEach((item) => {
          this.$refs.targetTable.toggleRowSelection(item, true);
        });
      },
    },
  },
  methods: {
    //\u5BF9\u67D0\u4E00\u884C\u8FDB\u884C\u70B9\u51FB\uFF0C\u5207\u6362\u663E\u793A\u9690\u85CF
    rowClick(row) {
      this.$refs.targetTable.toggleRowSelection(row);
    },
    //\u5BF9\u8868\u5934\u8FDB\u884C\u70B9\u51FB\uFF0C\u5207\u6362\u663E\u793A\u9690\u85CF
    rowHeaderClick() {
      this.$refs.targetTable.toggleAllSelection();
    },
    //\u5F53\u8868\u5934\u7684\u663E\u793A\u9690\u85CF\u53D1\u751F\u53D8\u5316\u65F6\uFF0C\u89E6\u53D1\u6B64\u65B9\u6CD5
    handlerSelectionChange(val) {
      this.visibleKeys = val.map((item) => item.key);
    },
    //\u5C06\u6240\u6709\u7684column\u6570\u636E\u4F20\u9012\u8FC7\u6765\uFF0C\u521D\u59CB\u5316\u65F6\u4F1A\u8C03\u7528
    columnData(data) {
      this.lossGridData = data;
    },
  },
};
